pragma solidity ^0.8.1;

import "../interfaces/IMethodNft.sol";
import "../interfaces/IMethodCall.sol";

//需要支持多个同时调用,采用递归的模式进行调用
contract MultiNftFlashLoan is IMethodCall {
    //是否需要一个user?
    function compareStr(bytes memory a,bytes memory b) internal returns (bool) {
        if (a.length != b.length) {
            return false;
        } else {
            return keccak256(a) == keccak256(b);
        }
    }

    function action(bytes memory actionData) external override {
        //这里进行判断也是可以的
        //给actionData一个特殊的判断 
        if (compareStr(actionData,bytes("final"))) {
            return ;
        }
        (address user,address nftAddress,uint256 nftID,bytes memory data) = abi.decode(actionData,(address,address,uint256,bytes));
        IMethodNft(nftAddress).funcCall(user,nftID,data);
    }
}
